    $(document).ready(function(){
        new Swiper('.giftSlider_', {
            watchSlidesProgress:!0,
            autoHeight:!0,
            navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"},
            breakpoints: {
                // when window width is >= 320px
                320: {
                    spaceBetween: 8,
                    slidesPerView: 1.2,
                },
                767: {
                    spaceBetween:20,
                    slidesPerView:2.5,
                }
              }
        });
    })
    
    $(document).ready(function(){
      $('.product_slider').slick({
          dots: false,
          arrows: true,
          autoplay:false,
          speed: 300,
          slidesToShow: 3,
          slidesToScroll: 1,
          focusOnSelect:true,      
          centerMode: false,
          responsive: [
              {
                  breakpoint: 768,
                  settings: {
                      slidesToScroll: 1,
                      slidesToShow: 1,
                      variableWidth: true,
                      infinite: false
                  }
              }
          ]
      });
      
    });
    
    /*-- FIX_HEADER_START --*/
    $(function(){
        var stickyHeaderTop = 40;
        $(window).scroll(function(){
            if( $(window).scrollTop() > stickyHeaderTop ) {
                if($('body').hasClass("fix-header") == false)
                {
                    $('body').addClass('fix-header');
                }
            } else {
                $('body').removeClass('fix-header');
            }
        });
    });
    /*-- FIX_HEADER_END --*/
    
    /*-- FIX_HEADER_START --*/
    $(function(){
        var $el = $('.stickySubmit');  //record the elem so you don't crawl the DOM everytime  
        var stickySubmitHeight = $('.stickySubmit').height()
        if($el.length > 0){
          var stickyHeaderTop = $el.position().top + stickySubmitHeight;  // passing "true" will also include the top and bottom margin
        }
        $(window).scroll(function(){
          if( $(window).scrollTop() > stickyHeaderTop ) {
            if($('body').hasClass("fix-price") == false)
            {
              $('body').addClass('fix-price');
            }
          } else {
            $('body').removeClass('fix-price');
          }
        });
    });
    /*-- FIX_HEADER_END --*/